inline int map(char c) {
    if ('a' <= c) return c - 'W';
    if ('A' <= c) return c - '7';
    return c - '0';
}

inline int Trie_insert(char* word) {
    int p = 0, len = strlen(word);
    for (int i = 0; i < len; ++i) {
        int toInt = map(word[i]);
        if (Trie[p][toInt] == 0) Trie[p][toInt] = ++TrieCnt;
        p = Trie[p][toInt];
    }
    if (Hash[p] == 0) Hash[p] = ++TokenCnt;
    return Hash[p];
}

inline int Trie_search(char* word) {
    int p = 0, len = strlen(word);
    for (int i = 0; i < len; ++i) p = Trie[p][map(word[i])];
    return Hash[p];
}

void exp_match(char *exp){
    int pos = 0;
    int tokenID;
    while(exp[pos]){
        switch(exp[pos]){
            case '(':
                stack_op[++StackOpCnt] = LEFT;
                ++pos;
                break;
            case ')':
                while(stack_op[StackOpCnt] != LEFT){
                    postfix[++ModExpLen] = stack_op[StackOpCnt--];
                }
                --StackOpCnt;
                ++pos;
                break;
            case '!':
                stack_op[++StackOpCnt] = NEG;
                ++pos;
                break;
            case '&':
                while(StackOpCnt >= 0 && stack_op[StackOpCnt] <= AND){//>= 0??
                    postfix[++ModExpLen] = stack_op[StackOpCnt--];
                }
                stack_op[++StackOpCnt] = AND;
                ++pos;
                break;
            case '|':
                while(StackOpCnt >= 0 && stack_op[StackOpCnt] <= OR){//>= 0??
                    postfix[++ModExpLen] = stack_op[StackOpCnt--];
                }
                stack_op[++StackOpCnt] = OR;
                ++pos;
                break;
            default:
                tokenID = 0;
                while(isalnum(exp[pos])) tokenID = Trie[tokenID][map(exp[pos++])];
                tokenID = Hash[tokenID];
                postfix[++ModExpLen] = tokenID;
                break;
        }
    }
    while(StackOpCnt >= 0){
        postfix[++ModExpLen] = stack_op[StackOpCnt--];
    }

    for(int i = 0; i <= ModExpLen; ++i){
        Bitset b;
        switch(postfix[i]){
            case NEG:
                for(int j = 0; j < SETSIZ; ++j) stack_token[StackTokenCnt].set[j] ^= ones;
                break;
            case AND:
                b = stack_token[StackTokenCnt--];
                for (int j = 0; j < SETSIZ; ++j) stack_token[StackTokenCnt].set[j] &= b.set[j];
                break;
            case OR:
                b = stack_token[StackTokenCnt--];
                for (int j = 0; j < SETSIZ; ++j) stack_token[StackTokenCnt].set[j] |= b.set[j];
                break;
            default:
                stack_token[++StackTokenCnt] = Token_Content[postfix[i]];
                break;
        }
    }
    StackTokenCnt = StackOpCnt = ModExpLen = -1;
}

inline void Table_reset() {
    for (int i = 1; i < NAMESIZ; ++i) forest.on[i] = false;
}

inline void make_set(int data) {
    forest.parent[data] = data;
    forest.size[data] = 1;
    forest.on[data] = true;
}

inline int find_set(int data) { 
    while (data != forest.parent[data]) data = forest.parent[data]; 
    return data;  
}

inline int table_union(int data1, int data2) {
    int set1 = find_set(data1), set2 = find_set(data2);
    if (set1 == set2) return -1;
    forest.size[set2] += forest.size[set1];
    forest.parent[set1] = set2;
    return set2;
    
} 
